// src/pages/Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import RecipeSuggestion from '../components/recipe/RecipeSuggestion';
import { FaUtensils, FaSearch, FaClock, FaStar, FaHeart } from 'react-icons/fa';

const Home = () => {
  const navigate = useNavigate();

  const featuredRecipes = [
    {
      id: 1,
      title: "Mercimek Çorbası",
      image: "https://i.lezzet.com.tr/images-xxlarge-recipe/mercimek_corbasi-221c57c5-aa19-4a45-96af-7cd3903a01f3.jpg",
      rating: 4.8,
      time: "45 dk"
    },
    {
      id: 2,
      title: "Karnıyarık",
      image: "https://i.lezzet.com.tr/images-xxlarge-recipe/karniyarik-33bd7382-1eff-4a68-8834-2f2d83ce84b7.jpg",
      rating: 4.7,
      time: "60 dk"
    },
    {
      id: 3,
      title: "Baklava",
      image: "https://i.lezzet.com.tr/images-xxlarge-recipe/ev-yapimi-baklava-5a661f2f-7bc4-4ae5-95d3-4f8256a2f242.jpg",
      rating: 4.9,
      time: "120 dk"
    }
  ];

  const categories = [
    { name: 'Çorbalar', icon: '🍲', color: '#FF6B6B' },
    { name: 'Ana Yemekler', icon: '🍖', color: '#4ECDC4' },
    { name: 'Tatlılar', icon: '🍰', color: '#FFD93D' },
    { name: 'Salatalar', icon: '🥗', color: '#95E1D3' },
    { name: 'Kahvaltılık', icon: '🍳', color: '#F38181' },
    { name: 'Mezeler', icon: '🥘', color: '#6C5CE7' }
  ];

  return (
    <div style={styles.container}>
      {/* Hero Section */}
      <div style={styles.hero}>
        <div style={styles.heroContent}>
          <h1 style={styles.heroTitle}>
            Lezzetli Yemeklerin <br />
            <span style={styles.highlight}>Sihirli Dünyasına</span> <br />
            Hoş Geldiniz
          </h1>
          <p style={styles.heroSubtitle}>
            Binlerce tarif, püf noktası ve mutfak sırları burada!
          </p>
          <div style={styles.heroButtons}>
            <button 
              style={styles.primaryButton}
              onClick={() => navigate('/recipes')}
            >
              <FaUtensils style={styles.buttonIcon} />
              Tarifleri Keşfet
            </button>
            <button 
              style={styles.secondaryButton}
              onClick={() => navigate('/add-recipe')}
            >
              <FaHeart style={styles.buttonIcon} />
              Tarif Paylaş
            </button>
          </div>
        </div>
        <div style={styles.heroImage}>
          {/* Hero görseli buraya */}
        </div>
      </div>

      {/* Malzeme Tabanlı Öneri Sistemi */}
      <RecipeSuggestion />

      {/* Kategoriler */}
      <section style={styles.section}>
        <h2 style={styles.sectionTitle}>Kategoriler</h2>
        <div style={styles.categories}>
          {categories.map((category, index) => (
            <div 
              key={index} 
              style={{
                ...styles.categoryCard,
                backgroundColor: category.color
              }}
              onClick={() => navigate(`/recipes?category=${category.name}`)}
            >
              <span style={styles.categoryIcon}>{category.icon}</span>
              <h3 style={styles.categoryTitle}>{category.name}</h3>
            </div>
          ))}
        </div>
      </section>

      {/* Öne Çıkan Tarifler */}
      <section style={styles.section}>
        <h2 style={styles.sectionTitle}>Öne Çıkan Tarifler</h2>
        <div style={styles.featuredRecipes}>
          {featuredRecipes.map(recipe => (
            <div 
              key={recipe.id} 
              style={styles.recipeCard}
              onClick={() => navigate(`/recipe/${recipe.id}`)}
            >
              <div style={styles.recipeImageContainer}>
                <img 
                  src={recipe.image} 
                  alt={recipe.title} 
                  style={styles.recipeImage}
                />
                <div style={styles.recipeOverlay}>
                  <span style={styles.recipeRating}>
                    <FaStar style={styles.ratingIcon} />
                    {recipe.rating}
                  </span>
                  <span style={styles.recipeTime}>
                    <FaClock style={styles.timeIcon} />
                    {recipe.time}
                  </span>
                </div>
              </div>
              <h3 style={styles.recipeTitle}>{recipe.title}</h3>
            </div>
          ))}
        </div>
      </section>

      {/* Özellikler */}
      <section style={styles.features}>
        <div style={styles.feature}>
          <FaSearch style={styles.featureIcon} />
          <h3>Kolay Arama</h3>
          <p>İstediğiniz tarifi saniyeler içinde bulun</p>
        </div>
        <div style={styles.feature}>
          <FaClock style={styles.featureIcon} />
          <h3>Hızlı Tarifler</h3>
          <p>30 dakikadan kısa süren pratik tarifler</p>
        </div>
        <div style={styles.feature}>
          <FaStar style={styles.featureIcon} />
          <h3>Kullanıcı Yorumları</h3>
          <p>Denenmiş ve beğenilmiş tarifler</p>
        </div>
      </section>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '20px',
  },
  hero: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between',
    padding: '4rem 0',
    backgroundColor: '#f8f9fa',
    borderRadius: '20px',
    marginBottom: '4rem',
    backgroundImage: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
  },
  heroContent: {
    padding: '0 4rem',
    flex: '1',
  },
  heroTitle: {
    fontSize: '3.5rem',
    color: '#2c3e50',
    marginBottom: '1.5rem',
    lineHeight: '1.2',
  },
  highlight: {
    color: '#e74c3c',
    fontWeight: 'bold',
  },
  heroSubtitle: {
    fontSize: '1.2rem',
    color: '#666',
    marginBottom: '2rem',
  },
  heroButtons: {
    display: 'flex',
